import React from "react";
import { Link } from "react-router-dom";
import "../App.css";
import { State } from "history";

const Navbar = () => {

  return (
    <div className="navdiv">
      <div>
        <ul className="ulnav">
          <li><Link className="links" to="/home">Home</Link></li>
          <li><Link className="links" to="/autok">Autok</Link></li>
          <li><Link className="links" to="/rolunk">Rolunk</Link></li>
          <li><Link className="reglog" to="/reg">Reg</Link></li>
          <li><Link className="reglog" to="/login">Login</Link></li>
        </ul>
      </div>
    </div>
  );
};
export default Navbar;
